Mean) ** 2;\n            }\n            const x = linspace(Math.min(...X), Math.max(...X), 30);\n            const slope = numerator / denominator; // Calculate the slope (m) of the line\n            const intercept = yMean - slope * XMean; // Calculate the y-intercept (b) of the line\n            const YValues = x.map((val) =&gt; slope * val + intercept);\n            \n            return { slope, intercept,x,YValues};\n        };\n        \n\n        \n        console.log(fit_data)\n        source3.data = fit_data;\n        source3.change.emit();\n        \n        \n        \n        "},"id":"430934","type":"CustomJS"},{"attributes":{},"id":"430967","type":"UnionRenderers"},{"attributes":{"formatter":{"id":"430998"},"major_label_orientation":0.7853981633974483,"major_label_policy":{"id":"431000"},"ticker":{"id":"430847"}},"id":"430846","type":"LinearAxis"},{"attributes":{},"id":"430968","type":"Selection"},{"attributes":{"bottom":{"field":"bottom"},"fill_alpha":{"value":0.5},"fill_color":{"value":"#3A5785"},"left":{"value":0},"line_alpha":{"value":0.5},"line_color":{"value":null},"right":{"field":"right"},"top":{"field":"top"}},"id":"430925","type":"Quad"},{"attributes":{},"id":"430952","type":"NoOverlap"},{"attributes":{},"id":"430980","type":"BasicTickFormatter"},{"attributes":{},"id":"430956","type":"Selection"},{"attributes":{},"id":"430979","type":"AllLabels"},{"attributes":{},"id":"430965","type":"UnionRenderers"},{"attributes":{"source":{"id":"430924"}},"id":"430928","type":"CDSView"},{"attributes":{"bottom":{"field":"bottom"},"fill_alpha":{"value":0.1},"fill_color":{"value":"#3A5785"},"left":{"value":0},"line_alpha":{"value":0.1},"line_color":{"value":null},"right":{"field":"right"},"top":{"field":"top"}},"id":"430930","type":"Quad"},{"attributes":{},"id":"430969","type":"UnionRenderers"},{"attributes":{},"id":"430960","type":"Selection"},{"attributes":{"children":[[{"id":"430777"},0,0],[{"id":"430884"},0,1],[{"id":"430834"},1,0]]},"id":"431011","type":"G
